import * as React from "react";

const NavigationItem = ({ label, isActive }) => {
    return (
        <div
            className={`gap-2 self-stretch p-2 rounded-lg ${
                isActive ? "text-green-400 bg-neutral-100" : ""
            } ${label ? "whitespace-nowrap" : "min-h-[32px] flex"}`}
            role="button"
            tabIndex={0}
        >
            {label}
        </div>
    );
};

export default NavigationItem;
